import React, { useState, useCallback, useEffect } from 'react';
import {
    Box,
    TextField,
    InputAdornment,
    IconButton,
    Paper,
    Typography,
    CircularProgress,
    Alert,
    Grid,
    Card,
    CardContent,
    Chip,
    Button,
    Autocomplete,
    Tooltip,
    LinearProgress,
} from '@mui/material';
import {
    Search as SearchIcon,
    Clear as ClearIcon,
    Build as BuildIcon,
    AttachMoney as MoneyIcon,
    Inventory as InventoryIcon,
    Cached as CachedIcon,
    Info as InfoIcon,
} from '@mui/icons-material';
import { MANUFACTURER_CODES, getManufacturerCode } from '../data/manufacturerCodes';
import vandvIplApi from '../services/vandvIplApi';

const PartsSearch = () => {
    const [searchQuery, setSearchQuery] = useState('');
    const [selectedManufacturer, setSelectedManufacturer] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);
    const [searchResults, setSearchResults] = useState([]);
    const [cacheStats, setCacheStats] = useState(null);

    // Convert manufacturer codes to options for autocomplete
    const manufacturerOptions = Object.entries(MANUFACTURER_CODES).map(([code, name]) => ({
        code,
        name,
        label: `${name} (${code})`
    }));

    // Load cache stats on mount
    useEffect(() => {
        updateCacheStats();
    }, []);

    const updateCacheStats = () => {
        const stats = vandvIplApi.getCacheStats();
        setCacheStats(stats);
    };

    const handleSearch = useCallback(async () => {
        if (!searchQuery.trim()) {
            setError('Please enter a part number or description');
            return;
        }

        setLoading(true);
        setError(null);
        setSearchResults([]);

        try {
            // Search using the IPL API with cache
            const results = await vandvIplApi.searchParts(
                searchQuery,
                selectedManufacturer?.code || null
            );

            setSearchResults(results);
            updateCacheStats(); // Update stats after search

            if (results.length === 0) {
                // Check if it might be a model number without modelId
                if (searchQuery.match(/^[A-Z0-9]{6,}$/)) {
                    setError(
                        `No parts found for "${searchQuery}". If this is a model number, we need the V&V model ID to fetch its parts. ` +
                        `Try searching for a specific part number or description instead.`
                    );
                } else {
                    setError(`No parts found matching "${searchQuery}"`);
                }
            }

        } catch (err) {
            console.error('Parts search error:', err);
            setError('Failed to search parts. Please try again.');
        } finally {
            setLoading(false);
        }
    }, [searchQuery, selectedManufacturer]);

    const handleKeyPress = (event) => {
        if (event.key === 'Enter') {
            handleSearch();
        }
    };

    const clearSearch = () => {
        setSearchQuery('');
        setSearchResults([]);
        setError(null);
    };

    const formatPrice = (price) => {
        return `$${price.toFixed(2)}`;
    };

    const getStockStatus = (quantity) => {
        if (quantity > 10) return { label: 'In Stock', color: 'success' };
        if (quantity > 0) return { label: `Only ${quantity} left`, color: 'warning' };
        return { label: 'Out of Stock', color: 'error' };
    };

    return (
        <Box sx={{ width: '100%', maxWidth: 800, mx: 'auto' }}>
            <Paper
                sx={{
                    p: 3,
                    borderRadius: 2,
                    backgroundColor: 'rgba(255, 255, 255, 0.9)',
                    backdropFilter: 'blur(10px)',
                }}
            >
                <Typography variant="h6" gutterBottom sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                    <BuildIcon color="primary" />
                    Search Appliance Parts
                </Typography>

                {/* Cache Status */}
                {cacheStats && (
                    <Box sx={{ mb: 2, display: 'flex', alignItems: 'center', gap: 1 }}>
                        <CachedIcon fontSize="small" color="action" />
                        <Typography variant="caption" color="text.secondary">
                            Cache: {cacheStats.totalParts} parts from {cacheStats.totalModels} models
                            {cacheStats.lastUpdated && ` â€¢ Updated ${new Date(cacheStats.lastUpdated).toLocaleTimeString()}`}
                        </Typography>
                    </Box>
                )}

                <Grid container spacing={2} sx={{ mt: 1 }}>
                    {/* Manufacturer Selection */}
                    <Grid item xs={12} md={4}>
                        <Autocomplete
                            value={selectedManufacturer}
                            onChange={(event, newValue) => setSelectedManufacturer(newValue)}
                            options={manufacturerOptions}
                            getOptionLabel={(option) => option.label}
                            renderInput={(params) => (
                                <TextField
                                    {...params}
                                    label="Manufacturer (Optional)"
                                    variant="outlined"
                                    fullWidth
                                    placeholder="All manufacturers..."
                                />
                            )}
                        />
                    </Grid>

                    {/* Part Number Search */}
                    <Grid item xs={12} md={8}>
                        <TextField
                            fullWidth
                            variant="outlined"
                            placeholder="Enter part number or description..."
                            value={searchQuery}
                            onChange={(e) => setSearchQuery(e.target.value)}
                            onKeyPress={handleKeyPress}
                            disabled={loading}
                            InputProps={{
                                startAdornment: (
                                    <InputAdornment position="start">
                                        <SearchIcon color="action" />
                                    </InputAdornment>
                                ),
                                endAdornment: searchQuery && (
                                    <InputAdornment position="end">
                                        <IconButton
                                            onClick={clearSearch}
                                            edge="end"
                                            size="small"
                                        >
                                            <ClearIcon />
                                        </IconButton>
                                    </InputAdornment>
                                ),
                            }}
                        />
                    </Grid>
                </Grid>

                <Button
                    variant="contained"
                    color="primary"
                    onClick={handleSearch}
                    disabled={loading || !searchQuery}
                    startIcon={loading ? <CircularProgress size={20} /> : <SearchIcon />}
                    sx={{ mt: 2 }}
                    fullWidth
                >
                    {loading ? 'Searching...' : 'Search Parts'}
                </Button>

                {error && (
                    <Alert severity="error" sx={{ mt: 2 }}>
                        {error}
                    </Alert>
                )}

                {/* Search Results */}
                {searchResults.length > 0 && (
                    <Box sx={{ mt: 3 }}>
                        <Typography variant="h6" gutterBottom>
                            Search Results ({searchResults.length})
                        </Typography>
                        <Grid container spacing={2}>
                            {searchResults.map((part, index) => {
                                const stockStatus = getStockStatus(part.quantity);
                                return (
                                    <Grid item xs={12} key={`${part.partNumber}-${index}`}>
                                        <Card>
                                            <CardContent>
                                                <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'start' }}>
                                                    <Box sx={{ flex: 1 }}>
                                                        <Typography variant="h6">
                                                            {part.partNumber}
                                                        </Typography>
                                                        <Typography variant="body2" color="text.secondary" gutterBottom>
                                                            {part.description}
                                                        </Typography>
                                                        {part.modelNumber && (
                                                            <Typography variant="caption" color="text.secondary">
                                                                From model: {part.modelNumber}
                                                            </Typography>
                                                        )}
                                                        <Box sx={{ display: 'flex', gap: 1, mt: 1, flexWrap: 'wrap' }}>
                                                            <Chip
                                                                icon={<MoneyIcon />}
                                                                label={formatPrice(part.price)}
                                                                color="primary"
                                                                size="small"
                                                            />
                                                            {part.listPrice > part.price && (
                                                                <Chip
                                                                    label={`List: ${formatPrice(part.listPrice)}`}
                                                                    size="small"
                                                                    sx={{ textDecoration: 'line-through' }}
                                                                />
                                                            )}
                                                            <Chip
                                                                icon={<InventoryIcon />}
                                                                label={stockStatus.label}
                                                                color={stockStatus.color}
                                                                size="small"
                                                            />
                                                            {part.matchedOn && (
                                                                <Chip
                                                                    label={`Matched: ${part.matchedOn}`}
                                                                    size="small"
                                                                    variant="outlined"
                                                                />
                                                            )}
                                                        </Box>
                                                    </Box>
                                                    {part.images && part.images.length > 0 && (
                                                        <Box
                                                            component="img"
                                                            src={part.images[0]}
                                                            alt={part.partNumber}
                                                            sx={{
                                                                width: 80,
                                                                height: 80,
                                                                objectFit: 'contain',
                                                                ml: 2,
                                                                borderRadius: 1,
                                                                border: '1px solid',
                                                                borderColor: 'divider',
                                                            }}
                                                        />
                                                    )}
                                                </Box>
                                            </CardContent>
                                        </Card>
                                    </Grid>
                                );
                            })}
                        </Grid>
                    </Box>
                )}

                {/* Info about how it works */}
                <Alert severity="info" sx={{ mt: 3 }} icon={<InfoIcon />}>
                    <Typography variant="body2">
                        <strong>How it works:</strong> Parts search uses the V&V IPL (Illustrated Parts List) API.
                        As you view appliance diagrams, parts data is cached locally for faster searching.
                        The more models you explore, the more comprehensive your search results become.
                    </Typography>
                </Alert>
            </Paper>
        </Box>
    );
};

export default PartsSearch;
